import { Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import AcademicProjects from './components/AcademicProjects';
import CaseStudies from './components/CaseStudies';
import ProductTeardowns from './components/ProductTeardowns';
import PRDs from './components/PRD';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/academic-projects" element={<AcademicProjects />} />
        <Route path="/case-studies" element={<CaseStudies />} />
        <Route path="/product-teardowns" element={<ProductTeardowns />} />
        <Route path="/prds" element={<PRD />} />
      </Routes>
    </div>
  );
}

export default App;
